<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8" />

</head>
<body>
<div id="map"></div>
<div id="panel">

    <button id="btnPause">Pause</button>

    <span id="currentTime" class="value">—</span>
    <span class="label">Points</span>

  </div>
</div>

  var tmin = 1758015644000;
  var tmax = 1758043322000;

  var map = L.map('map').setView([68.99018375, 15.556051583333335], 8);
  L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
    maxZoom: 19,
    attribution: '&copy; OpenStreetMap contributors'
  }).addTo(map);

  var full = L.polyline(points.map(p => [p.lat, p.lon]), {weight:2}).addTo(map);
  if (points.length) map.fitBounds(full.getBounds().pad(0.1));

  var tailPolyline = L.polyline([], {weight:4}).addTo(map);
  var headMarker = L.circleMarker([0,0], {radius:5}).addTo(map);

  var slider = document.getElementById('timeSlider');
  var currentTime = document.getElementById('currentTime');
  var countPts = document.getElementById('countPts');
  var btnPlay = document.getElementById('btnPlay');
  var btnPause = document.getElementById('btnPause');
  var speedInput = document.getElementById('speedInput');
  var tailInput = document.getElementById('tailInput');

  function formatTs(ms) {
    var d = new Date(ms);
    return d.toISOString();
  }

  function updateView(ms) {
    var tailMin = Math.max(0, Number(tailInput.value || 10)) * 60 * 1000;
    var tailStart = ms - tailMin;
    var seg = points.filter(p => p.t!=null && p.t >= tailStart && p.t <= ms);
    var coords = seg.map(p => [p.lat, p.lon]);
    if (coords.length) {
      tailPolyline.setLatLngs(coords);
      headMarker.setLatLng(coords[coords.length-1]);
    }
    currentTime.textContent = formatTs(ms);
    countPts.textContent = seg.length;
  }

  slider.addEventListener('input', function() {
    var ms = Number(slider.value);
    updateView(ms);
  });

  var playing = false;
  var lastTick = null;
  function tick(ts) {
    if (!playing) return;
    if (lastTick == null) lastTick = ts;
    var dt = ts - lastTick;
    lastTick = ts;
    var speed = Math.max(0.1, Number(speedInput.value || 1));
    var newVal = Number(slider.value) + dt * speed;
    if (newVal > tmax) newVal = tmin;
    slider.value = newVal;
    updateView(newVal);
    requestAnimationFrame(tick);
  }

  btnPlay.addEventListener('click', function() {
    if (!playing) {
      playing = true;
      lastTick = null;
      requestAnimationFrame(tick);
    }
  });
  btnPause.addEventListener('click', function() { playing = false; });

  // Initial draw
  slider.value = tmin;
  updateView(tmin);
</script>
